function Header() {
  return (
    <div className="grid grid-cols-12 h-16  items-center">
      <div className="col-start-2 col-span-7 border border-red-800">Test</div>
      <div className="col-span-3 space-x-2 justify-end border">
        <button className="bg-purple-400 px-5 py-1 rounded-md">Login</button>
        <button className="bg-purple-600 px-5 py-1 rounded-md">Sign Up</button>
      </div>
    </div>
  );
}

export default Header;
